import { classNames } from '../../helpers/ultility'
import DataIcon from '../icons/DataIcon'

const DataCard = props => {

  const { title, timer, data, imgUrl, styles} = props
  return (
    <div className="w-full">
      <div className="rounded-2x card-dashbord-data">
        <>
          <DataIcon imgUrl={imgUrl}/>
          {/* <div className="pt-4 pb-2 text-xl text-white font-bold"> */}
          <div className={classNames(styles.title)}>
            {title}
          </div>
          {/* <div className="pt-4 pb-2 text-xl text-white"> */}
          <div className={classNames(styles.timer)}>
            {timer}
          </div>
          {/* <div className="pt-4 pb-2 text-xl text-white"> */}
          <div className={classNames(styles.data)}>
            {data}
          </div>
        </>
      </div>
    </div>
  )
}

export default DataCard
